App.TemplesManager={register:function(){setTimeout(function(){App.DOM.Temples.children().bind('touchstart',App.TemplesManager.touch)},0)},setup:function(a){App.DOM.Temples.children().removeClass();App.DOM.Temples.children('[data-page='+a.pageID+']').addClass('invert');App.TemplesManager.hide()},show:function(){App.DOM.Temples.removeClass('invisible')},hide:function(){App.DOM.Temples.addClass('invisible')},touch:function(a){App.MenuManager.gotoPage($("#"+$(a.currentTarget).data("page")));a.stopPropagation()}};